class ChessBoard {

    DrawStalemate() {
        if(this.board.stalemate == false)
            return; 

        this.context.fillStyle = "white";
        this.context.fillRect(this.unit,this.unit, this.unit * 6, this.unit * 6);
        this.context.fillStyle = "black";
        this.context.font = this.unit + "px Arial";
        this.context.fillText("Stalemate!",this.unit + this.unit / 2, this.unit * 4, this.unit * 7);
    }
    DrawCheckMate() {
        if(this.board.winningColor == "") 
            return; 

        this.context.fillStyle = "white";
        this.context.fillRect(this.unit,this.unit, this.unit * 6, this.unit * 6);
        this.context.fillStyle = "black";
        this.context.font = this.unit + "px Arial";
        this.context.fillText(this.board.winningColor + " won!",this.unit + this.unit / 2, this.unit * 4, this.unit * 7);
    }
    DrawBoard() {
    
        let counter = 0; 
        for(let y = 0; y < 8; y++) {

            counter++;

            for(let x = 0; x < 8; x++) {

                counter++;
                let color = counter % 2 == 0 ? "grey" : "white";
                
                this.context.fillStyle = color; 
                this.context.fillRect(x * this.unit, y * this.unit, this.unit, this.unit);
            }
        }
    }
    DrawPieces() {

        this.context.strokeStyle = "black"; 
        this.context.lineWidth = 1; 
        for(let y = 0; y < 8; y++)
            for(let x = 0; x < 8; x++)
                if(this.board.GetPieceAtPosition(x,y) != null)
                        this.context.drawImage(this.board.GetPieceAtPosition(x,y).image, this.unit * x, this.unit * y, this.unit,this.unit);
    }
    Draw() {
        this.DrawBoard();
        this.DrawPieces();

        //Checking if king is in check for highlighting it.
        if(this.board.CheckForCheck("white")) {
            let kingPos = this.board.FindKing("white"); 
            this.HighlightCheck(kingPos.x, kingPos.y);
        } else if(this.board.CheckForCheck("black")) {
            let kingPos = this.board.FindKing("black"); 
            this.HighlightCheck(kingPos.x, kingPos.y);
        }
        this.DrawStalemate(); 
        this.DrawCheckMate(); 

    }
    HighlightMoves(moves) {

        for(let i = 0; i < moves.length; i++) {
            this.context.fillStyle = moveHighlightColor;

            this.context.beginPath();
            let radius = this.unit / 3; 
            let x = moves[i].x * this.unit + this.unit / 2;
            let y = moves[i].y * this.unit + this.unit / 2;
            this.context.arc(x, y, radius, 0, 2 * Math.PI);
            this.context.fill(); 
            this.context.stroke(); 
        }
    }
    HighlightCheck(x,y) {
        
        this.context.strokeStyle = checkHighlightColor;
        this.context.lineWidth = checkingLineWidth;  
        this.context.strokeRect(x * this.unit, y * this.unit, this.unit, this.unit);
    } 
    MouseDown(event) {

        this.mouseDownPosition.x = Math.ceil(event.clientX / this.unit) - 1; 
        this.mouseDownPosition.y = Math.ceil(event.clientY / this.unit) - 1; 

        let piece = this.board.GetPieceAtPosition(this.mouseDownPosition.x,this.mouseDownPosition.y);
        if(piece != null && piece != undefined && piece.color == this.board.turn) {
            this.mouseIsDown = true; 
            this.pieceOnHand = piece;
        }

    }
    MouseUp(event) {
        
        let destinationPosition = {
            x:Math.ceil(event.clientX / this.unit) - 1,
            y:Math.ceil(event.clientY / this.unit) - 1
        };
        
        if(this.mouseDownPosition.x == undefined) 
            return; 

        this.board.MakeMove(this.mouseDownPosition,destinationPosition); 
        this.Draw();
        this.mouseIsDown = false; 
    }
    constructor(canvas) {

        this.pieceOnHand = null;
        this.mouseIsDown = false; 
        this.rawMousePosition = {x:undefined, y:undefined}; 
        this.mouseDownPosition = {x:undefined,y:undefined};
        this.board = new Board();
        this.board.chessBoard = this;
        this.canvas = canvas;
        this.context = canvas.getContext("2d");
        this.unit = this.canvas.width / 8; 

        this.Draw();
        this.Draw(); 

        this.canvas.onmousemove = (event) => {

            this.rawMousePosition.x = event.clientX; 
            this.rawMousePosition.y = event.clientY; 
        }

        this.canvas.onmousedown = (event) => { this.MouseDown(event); }
        this.canvas.onmouseup = (event) => { this.MouseUp(event); }

        this.mouseInterval = setInterval(() => {

            if(this.mouseIsDown && this.pieceOnHand != null) {
                this.Draw(); 
                this.HighlightMoves(this.pieceOnHand.GetMoves());
                this.context.drawImage(this.pieceOnHand.image, this.rawMousePosition.x - (this.unit / 2), this.rawMousePosition.y - (this.unit / 2), this.unit,this.unit);
            }
        }, canvasRefreshRate);
    }
}

class Board {

    
    ChangeTurn() {

        this.turn = this.turn == "white" ? "black" : "white";
    }
    MakeMove(from, to) {

        let piece = this.GetPieceAtPosition(from.x,from.y);

        if(piece == null || piece == undefined || piece.color != this.turn )
            return; 

        let moves = piece.GetMoves(); 

        for(let i = 0; i < moves.length; i++) {
            if(moves[i].x == to.x && moves[i].y == to.y) {
                if(piece.type == "pawn" && from.x != to.x && this.GetPieceAtPosition(to.x,to.y) == null) {
                    
                    let y = piece.color == "white" ? -1 : 1; 
                    this.RemovePieceAtPosition(to.x,to.y - y);
                }

                this.RemovePieceAtPosition(from.x,from.y); 
                this.SetPieceAtPosition(to.x,to.y,piece);


                if(piece.type == "pawn") {
                    
                    piece.haveMoved = true; 
                    piece.doubleMovedLastTurn = (from.y == to.y + 2 || from.y == to.y - 2) ? true : false; 
                    
                    //Promiting pawn to queen. 
                    if(piece.color == "white" && piece.y == 0) {

                        this.SetPieceAtPosition(to.x,to.y,new Queen(piece.x,piece.y,piece.color,piece.board)); 

                    } else if(piece.color == "black" && piece.y == 7)
                        this.SetPieceAtPosition(to.x,to.y,new Queen(piece.x,piece.y,piece.color,piece.board)); 



                }
                else if(piece.type == "king") {
                    piece.haveMoved = true; 

                    //Castling
                    if(to.x - from.x == 2 || to.x - from.x == -2) {

                        let x = to.x - from.x == 2 ? 7 : 0; 
                        let newX = to.x - from.x == 2 ? 5 : 3; 
                        let y = piece.color == "white" ? 7 : 0;
                        let rook = this.GetPieceAtPosition(x,y); 
                        this.RemovePieceAtPosition(x,y); 
                        this.SetPieceAtPosition(newX,y,rook); 
                    }

                } else if(piece.type == "rook") {
                    piece.haveMoved = true; 
                }
                
                this.ChangeTurn(); 

                if(this.CheckForCheckMate(this.turn)) 
                    this.winningColor = this.turn == "white" ? "Black" : "White"; 
                
                if(this.CheckForStalemate(this.turn))
                    this.stalemate = true; 
                
                break; 
            }
        }
    }
    CheckIfMoveSetsYouInCheck(color, startPosition, movePiece, destination, destinationPiece) {
        
        this.SetPieceAtPosition(destination.x, destination.y, movePiece); 
        let checked = this.CheckForCheck(color);
        this.SetPieceAtPosition(startPosition.x,startPosition.y,movePiece);
        this.SetPieceAtPosition(destination.x,destination.y,destinationPiece); 

        return checked; 

    }
    FindKing(color) {
        let x = undefined; 
        let y = undefined; 

        //Finding king 
        for(let i = 0; i < this.pieces.length; i++)
            for(let j = 0; j < this.pieces[i].length; j++)
                if(this.pieces[i][j] != null)
                    if(this.pieces[i][j].color == color)
                        if(this.pieces[i][j].type == "king") {
                            
                            x = j; 
                            y = i; 
                        }

        return {x:x, y:y};
    }
    CheckForStalemate(color) {
        if(!this.CheckForCheck(color)) {
            for(let i = 0; i < this.pieces.length; i++)
                for(let j = 0; j < this.pieces[i].length; j++)
                    if(this.pieces[i][j] != null && this.pieces[i][j].color == color)

                        if(this.pieces[i][j].GetMoves().length != 0)
                            return false;
        } else 
            return false; 

        
        return true; 
    }
    CheckForCheckMate(color) {
    
        if(this.CheckForCheck(color)) {
            for(let i = 0; i < this.pieces.length; i++)
                for(let j = 0; j < this.pieces[i].length; j++)
                    if(this.pieces[i][j] != null && this.pieces[i][j].color == color)

                        if(this.pieces[i][j].GetMoves().length != 0)
                            return false;
        } else 
            return false; 

        
        return true; 
    }
    CheckForCheckDirectional(color, kingX, kingY, directionX, directionY) {
        for(let i = 1; i < 8; i++) {
            
            let x = kingX + (i * directionX); 
            let y = kingY + (i * directionY); 

            if(this.CheckIfMoveIsInBounds(x,y) && this.GetPieceAtPosition(x,y) != null) {
                if(this.GetPieceAtPosition(x,y).color == color)
                    break; 

                if((directionX != 0 && directionY == 0) || (directionX == 0 && directionY != 0)) {
                    if(this.GetPieceAtPosition(x,y).type == "queen" || this.GetPieceAtPosition(x,y).type == "rook") {
                        return true; 
                    }
                }
                else {
                    if(this.GetPieceAtPosition(x,y).type == "queen" || this.GetPieceAtPosition(x,y).type == "bishop") {
                        return true; 
                    }
                }


                break; 
            }
        }

        return false; 
    }
    
    CheckForCheck(color) {

        let kingX = 0; 
        let kingY = 0; 

        let kingPosition = this.FindKing(color); 
        kingX = kingPosition.x; 
        kingY = kingPosition.y; 

        //Checking upper left for pawn
        let yDirection = color == "white" ? -1 : 1; 
        let piece = this.GetPieceAtPosition(kingX - 1, kingY + yDirection); 
        if(piece != null && piece != undefined && piece.color != color && piece.type == "pawn") 
            return true;

        //Checking upper right for pawn
        piece = this.GetPieceAtPosition(kingX + 1, kingY + yDirection); 
        if(piece != null && piece != undefined && piece.color != color && piece.type == "pawn") 
            return true;


        if(this.CheckForCheckDirectional(color, kingX,kingY, 1, -1))
            return true; 

        if(this.CheckForCheckDirectional(color, kingX,kingY, -1, -1))
            return true; 

        if(this.CheckForCheckDirectional(color, kingX,kingY, 1, 1))
            return true; 

        if(this.CheckForCheckDirectional(color, kingX,kingY, -1, 1))
            return true; 

        if(this.CheckForCheckDirectional(color, kingX,kingY, 0, -1))
            return true; 

        if(this.CheckForCheckDirectional(color, kingX,kingY, 1, + 1))
            return true;

        if(this.CheckForCheckDirectional(color, kingX,kingY, -1, 0))
            return true; 

        if(this.CheckForCheckDirectional(color, kingX,kingY, 1, 0))
            return true; 

        if(this.CheckForCheckDirectional(color, kingX,kingY, 0, 1))
            return true; 
        
        
        //Checking for knights
        piece = this.GetPieceAtPosition(kingX + 1, kingY - 2);

        if(piece != null && piece != undefined && piece.color != color && piece.type == "knight")
            return true; 

        piece = this.GetPieceAtPosition(kingX + 2, kingY - 1);

        if(piece != null && piece != undefined && piece.color != color && piece.type == "knight")
            return true; 


        piece = this.GetPieceAtPosition(kingX - 1, kingY - 2);

        if(piece != null && piece != undefined && piece.color != color && piece.type == "knight")
            return true; 
        
        piece = this.GetPieceAtPosition(kingX - 2, kingY - 1);

        if(piece != null && piece != undefined && piece.color != color && piece.type == "knight")
            return true; 
            
        piece = this.GetPieceAtPosition(kingX + 1, kingY + 2);

        if(piece != null && piece != undefined && piece.color != color && piece.type == "knight")
            return true; 

        piece = this.GetPieceAtPosition(kingX + 2, kingY + 1);

        if(piece != null && piece != undefined && piece.color != color && piece.type == "knight")
            return true; 


        piece = this.GetPieceAtPosition(kingX - 1, kingY + 2);

        if(piece != null && piece != undefined && piece.color != color && piece.type == "knight")
            return true; 
        
        piece = this.GetPieceAtPosition(kingX - 2, kingY + 1);

        if(piece != null && piece != undefined && piece.color != color && piece.type == "knight")
            return true; 

        piece = this.GetPieceAtPosition(kingX - 1, kingY - 1); 
        
        if(piece != null && piece != undefined && piece.type == "king")
            return true; 

        piece = this.GetPieceAtPosition(kingX, kingY - 1); 
    
        if(piece != null && piece != undefined && piece.type == "king")
            return true; 

        piece = this.GetPieceAtPosition(kingX + 1, kingY - 1); 

        if(piece != null && piece != undefined && piece.type == "king")
            return true; 

        piece = this.GetPieceAtPosition(kingX + 1, kingY); 

        if(piece != null && piece != undefined && piece.type == "king")
            return true; 
        
        piece = this.GetPieceAtPosition(kingX + 1, kingY + 1); 

        if(piece != null && piece != undefined && piece.type == "king")
            return true; 
        
        piece = this.GetPieceAtPosition(kingX, kingY + 1); 

        if(piece != null && piece != undefined && piece.type == "king")
            return true; 
        
        piece = this.GetPieceAtPosition(kingX - 1, kingY + 1); 

        if(piece != null && piece != undefined && piece.type == "king")
            return true; 
            
        piece = this.GetPieceAtPosition(kingX - 1, kingY);

        if(piece != null && piece != undefined && piece.type == "king")
            return true;                                     

        return false; 
    }
    GetPieceAtPosition(x,y) { 

        try {
            return this.pieces[y][x];
        }catch(err) {
            return undefined; 
        }
        
    }
    CheckIfMoveIsInBounds(x,y) {
        return x <= 7 && x >= 0 && y <= 7 && y >= 0;
    }
    SetPieceAtPosition(x,y, piece) {
        
        if(piece != null) {
            this.RemovePieceAtPosition(piece.x,piece.y);
            piece.x = x; 
            piece.y = y;
        }

        this.pieces[y][x] = piece;
    }
    RemovePieceAtPosition(x,y) {
        this.pieces[y][x] = null;   
    }
    constructor() {
        this.turn = "white"; 
        this.stalemate = false; 
        this.winningColor = ""; 
        this.chessBoard = undefined; 
        this.pieces = [
            [new Rook(0,0,"black", this),new Knight(1,0,"black", this),new Bishop(2,0,"black", this),new Queen(3,0,"black", this),new King(4,0,"black", this),new Bishop(5,0,"black", this),new Knight(6,0,"black", this),new Rook(7,0,"black", this)],
            [new Pawn(0,1,"black", this),new Pawn(1,1,"black", this),new Pawn(2,1,"black", this),new Pawn(3,1,"black", this),new Pawn(4,1,"black", this),new Pawn(5,1, "black", this),new Pawn(6,1,"black", this),new Pawn(7,1,"black", this)],
            [null,null,null,null,null,null,null,null],
            [null,null,null,null,null,null,null,null],
            [null,null,null,null,null,null,null,null],
            [null,null,null,null,null,null,null,null],
            [new Pawn(0,6,"white", this),new Pawn(1,6,"white", this),new Pawn(2,6,"white", this),new Pawn(3,6,"white", this),new Pawn(4,6,"white", this),new Pawn(5,6,"white", this),new Pawn(6,6,"white", this),new Pawn(7,6,"white", this)],
            [new Rook(0,7,"white", this),new Knight(1,7,"white", this),new Bishop(2,7,"white", this),new Queen(3,7,"white", this),new King(4,7,"white", this),new Bishop(5,7,"white", this),new Knight(6,7,"white", this),new Rook(7,7,"white", this)]
        ];
    }
}

var moveLogic = {

    pawn : {

        DoubleMove : function(self) {

            //Double move forward.
            let x = self.color == "white" ? 0 : 0; 
            let y = self.color == "white" ? -2 : 2;

            let singleMoveY = self.color == "white" ? -1 : 1;  //   y = this.color == "white" ? -1 : 1;  
            
            if(self.board.CheckIfMoveIsInBounds(self.x+x, self.y+y))
                if(self.board.GetPieceAtPosition(self.x + x, self.y + y) == null && self.board.GetPieceAtPosition(self.x, self.y).haveMoved == false && self.board.GetPieceAtPosition(self.x, self.y).doubleMovedLastTurn == false && self.board.GetPieceAtPosition(self.x + x, self.y + singleMoveY) == null)
                    if(!self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:self.x+x,y:self.y+y},null))
                        return {x:self.x+x, y:self.y+y};


            return false;
        },

        SingleMove : function(self) {

            let x = 0; 
            let singleMoveY = self.color == "white" ? -1 : 1;
            
            if(self.board.CheckIfMoveIsInBounds(self.x+x, self.y+singleMoveY))
                if(self.board.GetPieceAtPosition(self.x + x, self.y + singleMoveY) == null)
                    if(!self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:self.x+x,y:self.y+singleMoveY},null))
                        return {x:self.x+x, y:self.y+singleMoveY};


            return false; 
        },
        enPassant : function(self, x) {

            let y = self.color == "white" ? -1 : 1; 

            if(self.board.CheckIfMoveIsInBounds(self.x+x, self.y+y))
            if(self.board.GetPieceAtPosition(self.x + x, self.y) != null) 
                if(self.board.GetPieceAtPosition(self.x + x, self.y).color != self.color)
                    if(self.board.GetPieceAtPosition(self.x + x, self.y).doubleMovedLastTurn == true)
                        if(!self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:self.x+x,y:self.y+y},null) && !self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x+x,y:self.y},null,{x:self.x+x,y:self.y},self.board.GetPieceAtPosition(self.x + x, self.y)))
                            return {x:self.x+x, y:self.y+y};

            return false; 
        },
        attack : function(self, x) {

            let y = self.color == "white" ? -1 : 1; 
            if(self.board.CheckIfMoveIsInBounds(self.x+x, self.y+y))
                if(self.board.GetPieceAtPosition(self.x + x, self.y + y) != null)
                    if(self.board.GetPieceAtPosition(self.x + x, self.y + y).color != self.color)
                        if(!self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:self.x+x,y:self.y+y},self.board.GetPieceAtPosition(self.x + x, self.y + y))) {

                            return {x:self.x+x, y:self.y+y};

                        }
        
            return false; 
        }
    },
    bishop : {

        diagonalMoves : function(self, directionX, directionY) {
            let moves = [];

            for(let i = 1; i <= 8; i++) {

                let x = self.x + (i * directionX);
                let y = self.y + (i * directionY);

                if(self.board.CheckIfMoveIsInBounds(x,y)) {

                    if(self.board.GetPieceAtPosition(x,y) != null && self.board.GetPieceAtPosition(x,y).color == self.color) {
                        return moves; 
                    }   
                    else if(!self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:x,y:y},self.board.GetPieceAtPosition(x,y))) {

                        if(self.board.GetPieceAtPosition(x,y) == null) {
                        
                            moves.push({x:x, y:y});
                        
                        } else {
    
                            if(self.board.GetPieceAtPosition(x,y).color != self.color) {
                                moves.push({x:x, y:y});
                                return moves; 
                            }
                        }
                    }
                }
            }

            if(moves.length == 0)
                return false; 

            return moves; 
        }
    },
    knight : {

        KnightMove : function(self, x, y) {

            if(self.board.CheckIfMoveIsInBounds(x, y))
                if(!self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:x,y:y},self.board.GetPieceAtPosition(x,y))) {
                    if(self.board.GetPieceAtPosition(x,y) == null) {
                        return {x:x,y:y};

                    } else if(self.board.GetPieceAtPosition(x,y).color != self.color)
                        return {x:x,y:y};
            }
            return false; 
        }
    },
    rook : {

        RookMoves : function(self, directionX, directionY) {

            let moves = [];

            for(let i = 1; i <= 8; i++) {
    
                let x = self.x + (i * directionX); 
                let y = self.y + (i * directionY); 
                
                if(self.board.CheckIfMoveIsInBounds(x, y))
                    if(!self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:x,y:y},self.board.GetPieceAtPosition(x,y))) {
        
                        if(self.board.GetPieceAtPosition(x,y) == null) {
                                moves.push({x:x,y:y});
            
                        } else if(self.board.GetPieceAtPosition(x,y).color != self.color) {
        
                            moves.push({x:x,y:y});
                            return moves; 
                            
                        } else if(self.board.GetPieceAtPosition(x,y).color == self.color) {
                            break; 
                        }
                            
                    }
            }
            if(moves == [])
                return false; 

            return moves; 
        }
    },
    king : {

        KingMove : function(self, x, y) {

            if(self.board.CheckIfMoveIsInBounds(x, y))
                if(!self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:x,y:y},self.board.GetPieceAtPosition(x,y))) {

                    if(self.board.GetPieceAtPosition(x,y) == null) {
                            return {x:x, y:y};
                        
                    }
                    else {

                        if(self.board.GetPieceAtPosition(x,y).color != self.color)
                            return {x:x, y:y};
                    }
                }
                
            return false; 
        },
        CastlingMove : function(self, directionX) {

            if(self.haveMoved == true)
                return false; 

            if(self.color == "white") {

                if(directionX == 1) {

                    let rook = self.board.GetPieceAtPosition(7,7);

                    if(rook == null || rook == undefined || rook.haveMoved == true || rook.type != "rook" || rook.color != self.color)
                        return false;
                    
                    if(self.board.GetPieceAtPosition(6,7) != null || self.board.GetPieceAtPosition(5,7) != null)
                        return false;

                    self.board.SetPieceAtPosition(5,7,rook); 
                    self.board.RemovePieceAtPosition(7,7); 

                    if(self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:6,y:7},null)) {

                        self.board.SetPieceAtPosition(7,7,rook); 
                        self.board.RemovePieceAtPosition(5,7); 
                        return false; 
                    } else {
                        self.board.SetPieceAtPosition(7,7,rook); 
                        self.board.RemovePieceAtPosition(5,7); 
                    }

                    return {x:6,y:7}; 

                } else if(directionX == -1) {
                    

                    let rook = self.board.GetPieceAtPosition(0,7);

                    if(rook == null || rook == undefined || rook.haveMoved == true || rook.type != "rook" || rook.color != self.color)
                        return false;
                    
                    if(self.board.GetPieceAtPosition(1,7) != null || self.board.GetPieceAtPosition(2,7) != null || self.board.GetPieceAtPosition(3,7) != null)
                        return false;

                    self.board.SetPieceAtPosition(3,7,rook); 
                    self.board.RemovePieceAtPosition(0,7); 

                    if(self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:2,y:7},null)) {

                        self.board.SetPieceAtPosition(0,7,rook); 
                        self.board.RemovePieceAtPosition(3,7); 
                        return false; 
                    } else {
                        self.board.SetPieceAtPosition(0,7,rook); 
                        self.board.RemovePieceAtPosition(3,7); 
                    }

                    return {x:2,y:7}; 
                }
            }else {
                if(directionX == 1) {

                    let rook = self.board.GetPieceAtPosition(7,0);

                    if(rook == null || rook == undefined || rook.haveMoved == true || rook.type != "rook" || rook.color != self.color)
                        return false;
                    
                    if(self.board.GetPieceAtPosition(6,0) != null || self.board.GetPieceAtPosition(5,0) != null)
                        return false;

                    self.board.SetPieceAtPosition(5,0,rook); 
                    self.board.RemovePieceAtPosition(7,0); 

                    if(self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:6,y:0},null)) {

                        self.board.SetPieceAtPosition(7,0,rook); 
                        self.board.RemovePieceAtPosition(5,0); 
                        return false; 
                    } else {
                        self.board.SetPieceAtPosition(7,0,rook); 
                        self.board.RemovePieceAtPosition(5,0); 
                    }

                    return {x:6,y:0}; 

                } else if(directionX == -1) {
                    

                    let rook = self.board.GetPieceAtPosition(0,0);

                    if(rook == null || rook == undefined || rook.haveMoved == true || rook.type != "rook" || rook.color != self.color)
                        return false;
                    
                    if(self.board.GetPieceAtPosition(1,0) != null || self.board.GetPieceAtPosition(2,0) != null || self.board.GetPieceAtPosition(3,0) != null)
                        return false;

                    self.board.SetPieceAtPosition(3,0,rook); 
                    self.board.RemovePieceAtPosition(0,0); 

                    if(self.board.CheckIfMoveSetsYouInCheck(self.color,{x:self.x,y:self.y},self,{x:2,y:0},null)) {

                        self.board.SetPieceAtPosition(0,0,rook); 
                        self.board.RemovePieceAtPosition(3,0); 
                        return false; 
                    } else {
                        self.board.SetPieceAtPosition(0,0,rook); 
                        self.board.RemovePieceAtPosition(3,0); 
                    }

                    return {x:2,y:0}; 
                }
            }
        }
    }
};
